import Table from 'react-bootstrap/Table';
import exercisesStore from '../stores/exercisesStore';

export default function ExercisesTable({workout_id}) {
    const store = exercisesStore();

    return(
    <div>
    <Table striped bordered hover variant="dark">
        <thead>
        <tr>
            <th>#</th>
            <th>Exercise</th>
            <th>Weight</th>
            <th>Sets</th>
            <th>Reps</th>
            <th>Intensity</th>
            <th>Notes</th>
            <td></td>
        </tr>
        </thead>
        <tbody>
            {store.exercises && store.exercises.map(exercise => {
                if (exercise.workout && exercise.workout.localeCompare(workout_id.id) === 0) {
                    return(
                        <tr>
                        <td>{exercise.number}</td>
                        <td>{exercise.name}</td>
                        <td>{exercise.weight}</td>
                        <td>{exercise.sets}</td>
                        <td>{exercise.reps}</td>
                        <td>{exercise.intensity}</td>
                        <td>{exercise.notes}</td>
                        <td>X</td>
                    </tr>
                    )
                }
            })}
        </tbody>
    </Table>
    <button onClick={() => store.createExercise(workout_id)}>Add</button>
    </div>


    );
}
